import React, { useEffect, useState } from "react";
import About from "/src/components/blocks/about/about";
import FeaturesList from "/src/components/blocks/features-list/features-list";
import FeaturePoolService from '../../../services/feature-pool-services/feature-pool-services'

function MainPage() {
	const [features, setFeatures] = useState([]);
	useEffect(() => {
		async () => {
			const featurePoolServices = new FeaturePoolServices();
			setFeatures(
				await featurePoolServices.getFeature([
					'feature1',
					'feature2',
					'feature3',
					'feature4'
				])
			);
		}
	}, []);

	return (
		<>
			<About />
			<FeaturesList>
				{FeaturePoolService.map((feature) => {
					<>feature</>
				})}
			</FeaturesList>
		</>
	);
}

export default MainPage;
